"link.dialog":'<div style="display:none" class="{{baseClass}}-panel">\n    <div class="{{baseClass}}-menu">\n        <p>_(\'Choose a link type:\')</p>\n        <fieldset></fieldset>\n    </div>\n    <div class="{{baseClass}}-wrap">\n        <div class="{{baseClass}}-content"></div>\n    </div>\n</div>\n',"link.email":'<h2>_(\'Link to an email address\')</h2>\n<fieldset class="{{baseClass}}-email">\n    <label for="{{baseClass}}-email">_(\'Email\')</label>\n    <input id="{{baseClass}}-email" name="email" type="text" placeholder="_(\'Enter email address\')"/>\n</fieldset>\n<fieldset class="{{baseClass}}-email">\n    <label for="{{baseClass}}-email-subject">_(\'Subject (optional)\')</label>\n    <input id="{{baseClass}}-email-subject" name="subject" type="text" placeholder="_(\'Enter subject\')"/>\n</fieldset>\n',
"link.error":'<div style="display:none" class="ui-widget {{baseClass}}-error-message {{messageClass}}">\n    <div class="ui-state-error ui-corner-all"> \n        <p>\n            <span class="ui-icon ui-icon-alert"></span> \n            {{message}}\n        </p>\n    </div>\n</div>',"link.external":'<h2>_(\'Link to a page on this or another website\')</h2>\n<fieldset>\n    <label for="{{baseClass}}-external-href">_(\'Location\')</label>\n    <input id="{{baseClass}}-external-href" value="http://" name="location" class="{{baseClass}}-external-href" type="text" placeholder="_(\'Enter your URL\')" />\n</fieldset>\n<h2>_(\'New window\')</h2>\n<fieldset>\n    <label for="{{baseClass}}-external-target">\n        <input id="{{baseClass}}-external-target" name="blank" type="checkbox" />\n        <span>_(\'Check this box to have the link open in a new browser window\')</span>\n    </label>\n</fieldset>\n<h2>_(\'Not sure what to put in the box above?\')</h2>\n<ol>\n    <li>_(\'Find the page on the web you want to link to\')</li>\n    <li>_(\'Copy the web address from your browser\'s address bar and paste it into the box above\')</li>\n</ol>\n',
"link.file-url":'<h2>_(\'Link to a document or other file\')</h2>\n<fieldset>\n    <label for="{{baseClass}}-external-href">_(\'Location\')</label>\n    <input id="{{baseClass}}-external-href" value="http://" name="location" class="{{baseClass}}-external-href" type="text" placeholder="_(\'Enter your URL\')" />\n</fieldset>\n<h2>_(\'New window\')</h2>\n<fieldset>\n    <label for="{{baseClass}}-external-target">\n        <input id="{{baseClass}}-external-target" name="blank" type="checkbox" />\n        <span>_(\'Check this box to have the file open in a new browser window\')</span>\n    </label>\n</fieldset>\n<h2>_(\'Not sure what to put in the box above?\')</h2>\n<ol>\n    <li>_(\'Ensure the file has been uploaded to your website\')</li>\n    <li>_(\'Open the uploaded file in your browser\')</li>\n    <li>_(\'Copy the file\'s URL from your browser\'s address bar and paste it into the box above\')</li>\n</ol>\n',
"link.label":'<label>\n    <input class="{{classes}}" type="radio" value="{{type}}" name="link-type" autocomplete="off"/>\n    <span>{{title}}</span>\n</label>\n',"paste.dialog":'<div class="ui-editor-paste-panel ui-dialog-content ui-widget-content">\n    <div class="ui-editor-paste-panel-tabs ui-tabs ui-widget ui-widget-content ui-corner-all">\n        <ul class="ui-tabs-nav ui-helper-reset ui-helper-clearfix ui-widget-header ui-corner-all">\n            <li class="ui-state-default ui-corner-top"><a>_(\'Plain Text\')</a></li>\n            <li class="ui-state-default ui-corner-top ui-tabs-selected ui-state-active"><a>_(\'Markup Only\')</a></li>\n            <li class="ui-state-default ui-corner-top"><a>_(\'Rich Text\')</a></li>\n            <li class="ui-state-default ui-corner-top"><a>_(\'Source Code\')</a></li>\n        </ul>\n        <label class="ui-editor-paste-synchronize-text" title="Synchronize changes to text across the three tabs">\n            <input type="checkbox" value="synchronize" name="synchronizeText" class="synchronizeText"/>\n            Synchronize\n        </label>\n        <div class="ui-editor-paste-plain-tab" style="display: none">\n            <textarea class="ui-editor-paste-area ui-editor-paste-plain">{{plain}}</textarea>\n        </div>\n        <div class="ui-editor-paste-markup-tab">\n            <div contenteditable="true" class="ui-editor-paste-area ui-editor-paste-markup">{{markup}}</div>\n        </div>\n        <div class="ui-editor-paste-rich-tab" style="display: none">\n            <div contenteditable="true" class="ui-editor-paste-area ui-editor-paste-rich">{{html}}</div>\n        </div>\n        <div class="ui-editor-paste-source-tab" style="display: none">\n            <textarea class="ui-editor-paste-area ui-editor-paste-source">{{html}}</textarea>\n        </div>\n    </div>\n</div>\n',
